import React from "react";
import { Link } from "react-router-dom";

function NavBar() {
    return (
        <>
        <nav className="navbar">
            <div>
                <Link to="/">
                    Home <i className="fab fa-typo3" />
                </Link>
                <div className="menuicon">
                    <i className={click ? 'fas fa-times' : 'fas fa-bars'} />

                </div>

            </div>
           
        </nav>
        </>
    );
}
export default NavBar;
